import React from 'react';
import '../styles/ItineraryResults.css';
import '../node_modules/bootstrap/dist/css/bootstrap.css';

export default class ItineraryResults extends React.Component {
    render() {
        return (
            <div>
            <h1> Your Itinerary </h1>

            <Container>
                <Row>
                    <Col> Day 1 </Col>
                    <Col> Day 2 </Col>
                    <Col> Day 3 </Col>
                </Row>
            </Container>
            </div>
        )
    }
}
